/**
 * Created by ovesh on 25/8/20.
 */
import React from 'react';
import {useState , useEffect } from 'react';

function Home(){

    const [data , setData] = useState([]);
    const fetchData = async () => {
       const Country =  await  fetch("https://gateway.ayoblajar.com/services/user-service/api/system/country/findAll/default");
       const countryData = await Country.json();
       setData(data =>  data = countryData);
    };

    useEffect( () => {
        fetchData();
    },[]);

    console.log("-------------------",data);
    return (
        <div>
            <div>
                {
                    data.map( val => (
                        <h1 key={val.id}>{val.name}</h1>
                    ))
                }
            </div>
            <p>your at home</p>
        </div>
    );
}


export default Home;
